ef=\"https:\/\/ru.wikipedia.org\/wiki\/1525_%D0%B3%D0%BE%D0%B4\" title=\"1525 \u0433\u043e\u0434\">1525<\/a>&#160;\u2014 \u043f\u043e\u0434 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B0%D0%B4-%D0%A4%D1%80%D0%B0%D0%BD%D0%BA%D0%B5%D0%BD%D1%85%D0%B0%D1%83%D0%B7%D0%B5%D0%BD-%D0%9A%D0%B8%D1%84%D1%85%D0%BE%D0%B9%D0%B7%D0%B5%D1%80\" title=\"\u0411\u0430\u0434-\u0424\u0440\u0430\u043d\u043a\u0435\u043d\u0445\u0430\u0443\u0437\u0435\u043d-\u041a\u0438\u0444\u0445\u043e\u0439\u0437\u0435\u0440\">\u0424\u0440\u0430\u043d\u043a\u0435\u043d\u0445\u0430\u0443\u0437\u0435\u043d\u043e\u043c<\/a> \u043e\u043a\u043e\u043d\u0447\u0430\u0442\u0435\u043b\u044c\u043d\u043e \u0440\u0430\u0437\u0431\u0438\u0442\u0430 \u043a\u0440\u0435\u0441\u0442\u044c\u044f\u043d\u0441\u043a\u0430\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%80%D0%BC%D0%B8%D1%8F\" title=\"\u0410\u0440\u043c\u0438\u044f\">\u0430\u0440\u043c\u0438\u044f<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D1%8E%D0%BD%D1%86%D0%B5%D1%80,_%D0%A2%D0%BE%D0%BC%D0%B0%D1%81\" title=\"\u041c\u044e\u043d\u0446\u0435\u0440, \u0422\u043e\u043c\u0430\u0441\">\u0422\u043e\u043c\u0430\u0441\u0430 \u041c\u044e\u043d\u0446\u0435\u0440\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1536_%D0%B3%D0%BE%D0%B4\" title=\"1536 \u0433\u043e\u0434\">1536<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B6%D0%BE%D1%80%D0%B4%D0%B6_%D0%91%D0%BE%D0%BB%D0%B5%D0%B9%D0%BD,_%D0%B2%D0%B8%D0%BA%D0%BE%D0%BD%D1%82_%D0%A0%D0%BE%D1%87%D1%84%D0%BE%D1%80%D0%B4\" class=\"mw-redirect\" title=\"\u0414\u0436\u043e\u0440\u0434\u0436 \u0411\u043e\u043b\u0435\u0439\u043d, \u0432\u0438\u043a\u043e\u043d\u0442 \u0420\u043e\u0447\u0444\u043e\u0440\u0434\">\u0414\u0436\u043e\u0440\u0434\u0436 \u0411\u043e\u043b\u0435\u0439\u043d, \u0432\u0438\u043a\u043e\u043d\u0442 \u0420\u043e\u0447\u0444\u043e\u0440\u0434<\/a>, \u0431\u0440\u0430\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D0%BD%D0%B0_%D0%91%D0%BE%D0%BB%D0%B5%D0%B9%D0%BD\" class=\"mw-redirect\" title=\"\u0410\u043d\u043d\u0430 \u0411\u043e\u043b\u0435\u0439\u043d\">\u0410\u043d\u043d\u044b \u0411\u043e\u043b\u0435\u0439\u043d<\/a>, \u043e\u0441\u0443\u0436\u0434\u0451\u043d\u043d\u044b\u0439 \u0441\u0443\u0434\u043e\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D0%BD%D1%80%D0%B8%D1%85_VIII\" title=\"\u0413\u0435\u043d\u0440\u0438\u0445 VIII\">\u0413\u0435\u043d\u0440\u0438\u0445\u0430 VIII<\/a>, \u0431\u044b\u043b \u043a\u0430\u0437\u043d\u0451\u043d \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B0%D1%83%D1%8D%D1%80_%D0%A5%D0%B8%D0%BB%D0%BB\" class=\"mw-redirect\" title=\"\u0422\u0430\u0443\u044d\u0440 \u0425\u0438\u043b\u043b\">\u0422\u0430\u0443\u044d\u0440 \u0425\u0438\u043b\u043b<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1590_%D0%B3%D0%BE%D0%B4\" title=\"1590 \u0433\u043e\u0434\">1590<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D0%BD%D0%B0_%D0%94%D0%B0%D1%82%D1%81%D0%BA%D0%B0%D1%8F_(%D0%BA%D0%BE%D1%80%D0%BE%D0%BB%D0%B5%D0%B2%D0%B0_%D0%90%D0%BD%D0%B3%D0%BB%D0%B8%D0%B8)\" class=\"mw-redirect\" title=\"\u0410\u043d\u043d\u0430 \u0414\u0430\u0442\u0441\u043a\u0430\u044f (\u043a\u043e\u0440\u043e\u043b\u0435\u0432\u0430 \u0410\u043d\u0433\u043b\u0438\u0438)\">\u0410\u043d\u043d\u0430 \u0414\u0430\u0442\u0441\u043a\u0430\u044f<\/a> \u0441\u0442\u0430\u043b\u0430 \u043a\u043e\u0440\u043e\u043b\u0435\u0432\u043e\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%BE%D1%82%D0%BB%D0%B0%D0%BD%D0%B4%D0%B8%D1%8F\" title=\"\u0428\u043e\u0442\u043b\u0430\u043d\u0434\u0438\u044f\">\u0428\u043e\u0442\u043b\u0430\u043d\u0434\u0438\u0438<\/a>.<\/li><\/ul><h3>XVII \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1606_%D0%B3%D0%BE%D0%B4\" title=\"1606 \u0433\u043e\u0434\">1606<\/a>&#160;\u2014 \u0432\u043e\u0441\u0441\u0442\u0430\u043d\u0438\u0435 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0\" title=\"\u041c\u043e\u0441\u043a\u0432\u0430\">\u041c\u043e\u0441\u043a\u0432\u0435<\/a> \u043f\u0440\u043e\u0442\u0438\u0432 \u0437\u0430\u0445\u0432\u0430\u0442\u0447\u0438\u043a\u043e\u0432&#160;\u2014 \u0432\u043e\u0439\u0441\u043a \u0420\u0435\u0447\u0438 \u041f\u043e\u0441\u043f\u043e\u043b\u0438\u0442\u043e\u0439. \u041d\u0430 \u0434\u0435\u0432\u044f\u0442\u044b\u0439 \u0434\u0435\u043d\u044c \u043f\u043e\u0441\u043b\u0435 \u0432\u0435\u043d\u0447\u0430\u043d\u0438\u044f \u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BD%D0%B8%D1%88%D0%B5%D0%BA,_%D0%9C%D0%B0%D1%80%D0%B8%D0%BD%D0%B0_%D0%AE%D1%80%D1%8C%D0%B5%D0%B2%D0%BD%D0%B0\" title=\"\u041c\u043d\u0438\u0448\u0435\u043a, \u041c\u0430\u0440\u0438\u043d\u0430 \u042e\u0440\u044c\u0435\u0432\u043d\u0430\">\u041c\u0430\u0440\u0438\u043d\u043e\u0439 \u041c\u043d\u0438\u0448\u0435\u043a<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B6%D0%B5%D0%B4%D0%BC%D0%B8%D1%82%D1%80%D0%B8%D0%B9_I\" title=\"\u041b\u0436\u0435\u0434\u043c\u0438\u0442\u0440\u0438\u0439 I\">\u041b\u0436\u0435\u0434\u043c\u0438\u0442\u0440\u0438\u0439 I<\/a> \u0443\u0431\u0438\u0442 \u0438 \u0441\u043e\u0436\u0436\u0451\u043d. \u041f\u0435\u043f\u043b\u043e\u043c \u0437\u0430\u0440\u044f\u0436\u0435\u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A6%D0%B0%D1%80%D1%8C-%D0%BF%D1%83%D1%88%D0%BA%D0%B0\" title=\"\u0426\u0430\u0440\u044c-\u043f\u0443\u0448\u043a\u0430\">\u0426\u0430\u0440\u044c-\u043f\u0443\u0448\u043a\u0430<\/a>. \u0415\u0434\u0438\u043d\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439 \u0432\u044b\u0441\u0442\u0440\u0435\u043b \u0440\u0430\u0437\u0432\u0435\u0438\u0432\u0430\u0435\u0442 \u043f\u0440\u0430\u0445 \u0441\u0430\u043c\u043e\u0437\u0432\u0430\u043d\u0446\u0430. \u041c\u0430\u0440\u0438\u043d\u0430 \u041c\u043d\u0438\u0448\u0435\u043a \u0430\u0440\u0435\u0441\u0442\u043e\u0432\u0430\u043d\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1642_%D0%B3%D0%BE%D0%B4\" title=\"1642 \u0433\u043e\u0434\">1642<\/a>&#160;\u2014 \u043e\u0441\u043d\u043e\u0432\u0430\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D0%BD%D1%80%D0%B5%D0%B0%D0%BB%D1%8C\" title=\"\u041c\u043e\u043d\u0440\u0435\u0430\u043b\u044c\">\u041c\u043e\u043d\u0440\u0435\u0430\u043b\u044c<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1656_%D0%B3%D0%BE%D0%B4\" title=\"1656 \u0433\u043e\u0434\">1656<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D1%8F\" title=\"\u0420\u043e\u0441\u0441\u0438\u044f\">\u0420\u043e\u0441\u0441\u0438\u044f<\/a> \u0432\u0441\u0442\u0443\u043f\u0430\u0435\u0442 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B5%D0%B2%D0%B5%D1%80%D0%BD%D1%8B%D0%B5_%D0%B2%D0%BE%D0%B9%D0%BD%D1%8B\" class=\"mw-redirect\" title=\"\u0421\u0435\u0432\u0435\u0440\u043d\u044b\u0435 \u0432\u043e\u0439\u043d\u044b\">\u0421\u0435\u0432\u0435\u0440\u043d\u0443\u044e \u0432\u043e\u0439\u043d\u0443 1655\u20141660&#160;\u0433\u0433.<\/a>, \u043e\u0431\u044a\u044f\u0432\u0438\u0432 \u0432\u043e\u0439\u043d\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%B2%D0%B5%D1%86%D0%B8%D1%8F\" title=\"\u0428\u0432\u0435\u0446\u0438\u044f\">\u0428\u0432\u0435\u0446\u0438\u0438<\/a> \u0438 \u043d\u0430\u0447\u0430\u0432 \u043d\u0430 \u0441\u043b\u0435\u0434\u0443\u044e\u0449\u0438\u0439 \u0434\u0435\u043d\u044c \u0432\u043e\u0435\u043d\u043d\u044b\u0435 \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u044f.<\/li><\/ul><h3>XVIII \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1703_%D0%B3%D0%BE%D0%B4\" title=\"1703 \u0433\u043e\u0434\">1703<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D0%BB%D0%BE%D1%82\" title=\"\u0424\u043b\u043e\u0442\">\u0440\u0443\u0441\u0441\u043a\u0438\u0439 \u0444\u043b\u043e\u0442<\/a> \u043e\u0434\u0435\u0440\u0436\u0430\u043b \u0441\u0432\u043e\u044e \u043f\u0435\u0440\u0432\u0443\u044e \u043f\u043e\u0431\u0435\u0434\u0443 (\u043d\u0430\u0434 \u0434\u0432\u0443\u043c\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%B2%D0%B5%D1%86%D0%B8%D1%8F\" title=\"\u0428\u0432\u0435\u0446\u0438\u044f\">\u0448\u0432\u0435\u0434\u0441\u043a\u0438\u043c\u0438<\/a> \u043a\u043e\u0440\u0430\u0431\u043b\u044f\u043c\u0438 \u0432 \u0443\u0441\u0442\u044c\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B5%D0%B2%D0%B0\" title=\"\u041d\u0435\u0432\u0430\">\u041d\u0435\u0432\u044b<\/a>).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1718_%D0%B3%D0%BE%D0%B4\" title=\"1718 \u0433\u043e\u0434\">1718<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D0%B3%D0%BB%D0%B8%D1%8F\" title=\"\u0410\u043d\u0433\u043b\u0438\u044f\">\u0430\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u0438\u0439<\/a> \u044e\u0440\u0438\u0441\u0442 <a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%9F%D0%B0%D0%BA%D0%BB,_%D0%94%D0%B6%D0%B5%D0%B9%D0%BC%D1%81&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u041f\u0430\u043a\u043b, \u0414\u0436\u0435\u0439\u043c\u0441 (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u0414\u0436\u0435\u0439\u043c\u0441 \u041f\u0430\u043a\u043b<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D0%B3%D0%BB%D0%B8%D0%B9%D1%81%D0%BA%D0%B8%D0%B9_%D1%8F%D0%B7%D1%8B%D0%BA\" title=\"\u0410\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u0438\u0439 \u044f\u0437\u044b\u043a\">\u0430\u043d\u0433\u043b.<\/a>&#160;<a href=\"https:\/\/en.wikipedia.org\/wiki\/James_Puckle\" class=\"extiw\" title=\"en:James Puckle\">James Puckle<\/a>) \u0437\u0430\u043f\u0430\u0442\u0435\u043d\u0442\u043e\u0432\u0430\u043b \u043f\u0435\u0440\u0432\u044b\u0439 \u0432 \u043c\u0438\u0440\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%83%D0%BB%D0%B5%D0%BC%D1%91%D1%82\" title=\"\u041f\u0443\u043b\u0435\u043c\u0451\u0442\">\u043f\u0443\u043b\u0435\u043c\u0451\u0442<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D1%83%D0%B6%D1%8C%D1%91_%D0%9F%D0%B0%D0%BA%D0%BB%D0%B0\" title=\"\u0420\u0443\u0436\u044c\u0451 \u041f\u0430\u043a\u043b\u0430\">\u0440\u0443\u0436\u044c\u0451 \u041f\u0430\u043a\u043b\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1727_%D0%B3%D0%BE%D0%B4\" title=\"1727 \u0433\u043e\u0434\">1727<\/a>&#160;\u2014 \u041d\u0430 \u0440\u0443\u0441\u0441\u043a\u0438\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D0%B5%D1%81%D1%82%D0%BE%D0%BB\" title=\"\u041f\u0440\u0435\u0441\u0442\u043e\u043b\">\u043f\u0440\u0435\u0441\u0442\u043e\u043b<\/a> \u0432\u0441\u0442\u0443\u043f\u0438\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%91%D1%82%D1%80_II\" title=\"\u041f\u0451\u0442\u0440 II\">\u041f\u0451\u0442\u0440 II<\/a>, \u043c\u0430\u043b\u043e\u043b\u0435\u0442\u043d\u0438\u0439 \u0432\u043d\u0443\u043a <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%91%D1%82%D1%80_I\" title=\"\u041f\u0451\u0442\u0440 I\">\u041f\u0435\u0442\u0440\u0430 I<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1742_%D0%B3%D0%BE%D0%B4\" title=\"1742 \u0433\u043e\u0434\">1742<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B8%D0%B4%D1%80%D0%B8%D1%85_II_(%D0%BA%D0%BE%D1%80%D0%BE%D0%BB%D1%8C_%D0%9F%D1%80%D1%83%D1%81%D1%81%D0%B8%D0%B8)\" title=\"\u0424\u0440\u0438\u0434\u0440\u0438\u0445 II (\u043a\u043e\u0440\u043e\u043b\u044c \u041f\u0440\u0443\u0441\u0441\u0438\u0438)\">\u0424\u0440\u0438\u0434\u0440\u0438\u0445 II<\/a> \u0440\u0430\u0437\u0431\u0438\u043b \u0430\u0432\u0441\u0442\u0440\u0438\u0439\u0446\u0435\u0432 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%80%D0%B0%D0%B6%D0%B5%D0%BD%D0%B8%D0%B5_%D0%BF%D1%80%D0%B8_%D0%A8%D0%BE%D1%82%D1%83%D0%B7%D0%B8%D1%86%D0%B5\" class=\"mw-redirect\" title=\"\u0421\u0440\u0430\u0436\u0435\u043d\u0438\u0435 \u043f\u0440\u0438 \u0428\u043e\u0442\u0443\u0437\u0438\u0446\u0435\">\u0431\u0438\u0442\u0432\u0435 \u0443 \u0428\u043e\u0442\u0443\u0437\u0438\u0446\u0430<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B8%D0%BB%D0%B5%D0%B7%D0%B8%D1%8F\" title=\"\u0421\u0438\u043b\u0435\u0437\u0438\u044f\">\u0421\u0438\u043b\u0435\u0437\u0438\u044f<\/a>).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1787_%D0%B3%D0%BE%D0%B4\" title=\"1787 \u0433\u043e\u0434\">1787<\/a>&#160;\u2014 \u0438\u0437-\u0437\u0430 \u0441\u0438\u043b\u044c\u043d\u043e\u0433\u043e \u0432\u0435\u0442\u0440\u0430 \u043e\u043f\u0440\u043e\u043a\u0438\u043d\u0443\u043b\u043e\u0441\u044c \u0430\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u043e\u0435 \u0441\u0443\u0434\u043d\u043e \u00ab\u0421\u0438\u0441\u0442\u0435\u0440\u0441\u00bb, \u043d\u0430 \u043a\u043e\u0442\u043e\u0440\u043e\u043c \u0438\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%84%D1%80%D0%B8%D0%BA%D0%B0\" title=\"\u0410\u0444\u0440\u0438\u043a\u0430\">\u0410\u0444\u0440\u0438\u043a\u0438<\/a> \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%83%D0%B1%D0%B0\" title=\"\u041a\u0443\u0431\u0430\">\u041a\u0443\u0431\u0443<\/a> \u043f\u0435\u0440\u0435\u0432\u043e\u0437\u0438\u043b\u0438\u0441\u044c \u0440\u0430\u0431\u044b&#160;\u2014 \u043e\u043a\u043e\u043b\u043e 300 \u0447\u0435\u043b\u043e\u0432\u0435\u043a \u043f\u043e\u0433\u0438\u0431\u043b\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1792_%D0%B3%D0%BE%D0%B4\" title=\"1792 \u0433\u043e\u0434\">1792<\/a>&#160;\u2014 \u0441\u043f\u0440\u044f\u0442\u0430\u0432\u0448\u0438\u0435\u0441\u044f \u043e\u0442 \u0441\u043e\u043b\u043d\u0446\u0430 \u043f\u043e\u0434 \u0442\u0435\u043d\u044c\u044e \u0440\u0430\u0441\u043a\u0438\u0434\u0438\u0441\u0442\u043e\u0433\u043e \u0434\u0435\u0440\u0435\u0432\u0430 24 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%80%D0%BE%D0%BA%D0%B5%D1%80\" title=\"\u0411\u0440\u043e\u043a\u0435\u0440\">\u0431\u0440\u043e\u043a\u0435\u0440\u0430<\/a> \u043e\u0441\u043d\u043e\u0432\u044b\u0432\u0430\u044e\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D1%8C%D1%8E-%D0%99%D0%BE%D1%80%D0%BA\" title=\"\u041d\u044c\u044e-\u0419\u043e\u0440\u043a\">\u041d\u044c\u044e-\u0419\u043e\u0440\u043a\u0441\u043a\u0443\u044e<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D0%BE%D0%BD%D0%B4%D0%BE%D0%B2%D0%B0%D1%8F_%D0%B1%D0%B8%D1%80%D0%B6%D0%B0\" title=\"\u0424\u043e\u043d\u0434\u043e\u0432\u0430\u044f \u0431\u0438\u0440\u0436\u0430\">\u0444\u043e\u043d\u0434\u043e\u0432\u0443\u044e \u0431\u0438\u0440\u0436\u0443<\/a>. \u0422\u0430\u043c, \u0433\u0434\u0435 \u0440\u043e\u0441\u043b\u043e \u044d\u0442\u043e \u0434\u0435\u0440\u0435\u0432\u043e, \u0441\u0435\u0433\u043e\u0434\u043d\u044f \u0440\u0430\u0441\u043f\u043e\u043b\u043e\u0436\u0435\u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A3%D0%BE%D0%BB%D0%BB-%D1%81%D1%82%D1%80%D0%B8%D1%82\" title=\"\u0423\u043e\u043b\u043b-\u0441\u0442\u0440\u0438\u0442\">\u0423\u043e\u043b\u043b-\u0441\u0442\u0440\u0438\u0442<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1799_%D0%B3%D0%BE%D0%B4\" title=\"1799 \u0433\u043e\u0434\">1799<\/a>&#160;\u2014 \u043f\u043e\u0441\u043b\u0435 \u043d\u0435\u0443\u0434\u0430\u0447\u043d\u043e\u0439 \u043f\u043e\u043f\u044b\u0442\u043a\u0438 \u0437\u0430\u0445\u0432\u0430\u0442\u0438\u0442\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BA%D0%BA%D0%BE_(%D0%B3%D0%BE%D1%80%D0%BE%D0%B4)\" class=\"mw-redirect\" title=\"\u0410\u043a\u043a\u043e (\u0433\u043e\u0440\u043e\u0434)\">\u0410\u043a\u0440\u0443<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B0%D0%BF%D0%BE%D0%BB%D0%B5%D0%BE%D0%BD_I_%D0%91%D0%BE%D0%BD%D0%B0%D0%BF%D0%B0%D1%80%D1%82\" class=\"mw-redirect\" title=\"\u041d\u0430\u043f\u043e\u043b\u0435\u043e\u043d I \u0411\u043e\u043d\u0430\u043f\u0430\u0440\u0442\">\u041d\u0430\u043f\u043e\u043b\u0435\u043e\u043d<\/a> \u043e\u0442\u0441\u0442\u0443\u043f\u0438\u043b \u0438\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D0%BB%D0%B5%D1%81%D1%82%D0%B8%D0%BD%D0%B0\" title=\"\u041f\u0430\u043b\u0435\u0441\u0442\u0438\u043d\u0430\">\u041f\u0430\u043b\u0435\u0441\u0442\u0438\u043d\u044b<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%95%D0%B3%D0%B8%D0%BF%D0%B5%D1%82\" title=\"\u0415\u0433\u0438\u043f\u0435\u0442\">\u0415\u0433\u0438\u043f\u0435\u0442<\/a>.<\/li><\/ul><h3>XIX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1805_%D0%B3%D0%BE%D0%B4\" title=\"1805 \u0433\u043e\u0434\">1805<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D1%83%D1%85%D0%B0%D0%BC%D0%BC%D0%B5%D0%B4_%D0%90%D0%BB%D0%B8_%D0%95%D0%B3%D0%B8%D0%BF%D0%B5%D1%82%D1%81%D0%BA%D0%B8%D0%B9\" title=\"\u041c\u0443\u0445\u0430\u043c\u043c\u0435\u0434 \u0410\u043b\u0438 \u0415\u0433\u0438\u043f\u0435\u0442\u0441\u043a\u0438\u0439\">\u041c\u0443\u0445\u0430\u043c\u043c\u0435\u0434 \u0410\u043b\u0438<\/a> \u0441\u0442\u0430\u043d\u043e\u0432\u0438\u0442\u0441\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B0%D0%BB%D0%B8_(%D0%B4%D0%BE%D0%BB%D0%B6%D0%BD%D0%BE%D1%81%D1%82%D1%8C)\" title=\"\u0412\u0430\u043b\u0438 (\u0434\u043e\u043b\u0436\u043d\u043e\u0441\u0442\u044c)\">\u0412\u0430\u043b\u0438<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%95%D0%B3%D0%B8%D0%BF%D0%B5%D1%82_(%D1%8D%D1%8F%D0%BB%D0%B5%D1%82)\" title=\"\u0415\u0433\u0438\u043f\u0435\u0442 (\u044d\u044f\u043b\u0435\u0442)\">\u0415\u0433\u0438\u043f\u0442\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1808_%D0%B3%D0%BE%D0%B4\" title=\"1808 \u0433\u043e\u0434\">1808<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%BC%D0%BF%D0%B5%D1%80%D0%B0%D1%82%D0%BE%D1%80\" title=\"\u0418\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440\">\u0438\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B0%D0%BF%D0%BE%D0%BB%D0%B5%D0%BE%D0%BD_I_%D0%91%D0%BE%D0%BD%D0%B0%D0%BF%D0%B0%D1%80%D1%82\" class=\"mw-redirect\" title=\"\u041d\u0430\u043f\u043e\u043b\u0435\u043e\u043d I \u0411\u043e\u043d\u0430\u043f\u0430\u0440\u0442\">\u041d\u0430\u043f\u043e\u043b\u0435\u043e\u043d I<\/a> \u0438\u0437\u0434\u0430\u0451\u0442 \u0434\u0435\u043a\u0440\u0435\u0442, \u043e\u0431\u044a\u044f\u0432\u0438\u0432\u0448\u0438\u0439, \u0447\u0442\u043e \u0433\u043b\u0430\u0432\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D0%BF%D1%81%D1%82%D0%B2%D0%BE\" title=\"\u041f\u0430\u043f\u0441\u0442\u0432\u043e\">\u043a\u0430\u0442\u043e\u043b\u0438\u0447\u0435\u0441\u043a\u043e\u0439 \u0446\u0435\u0440\u043a\u0432\u0438<\/a> \u043b\u0438\u0448\u0430\u0435\u0442\u0441\u044f \u0441\u0432\u0435\u0442\u0441\u043a\u043e\u0439 \u0432\u043b\u0430\u0441\u0442\u0438, \u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B8%D0%BC\" title=\"\u0420\u0438\u043c\">\u0420\u0438\u043c<\/a> \u0438 \u0432\u0441\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D0%BF%D1%81%D0%BA%D0%B0%D1%8F_%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D1%8C\" title=\"\u041f\u0430\u043f\u0441\u043a\u0430\u044f \u043e\u0431\u043b\u0430\u0441\u0442\u044c\">\u0432\u043b\u0430\u0434\u0435\u043d\u0438\u044f \u043f\u0430\u043f\u044b<\/a> \u043f\u0440\u0438\u0441\u043e\u0435\u0434\u0438\u043d\u044f\u044e\u0442\u0441\u044f \u043a \u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u043e\u0439 \u0438\u043c\u043f\u0435\u0440\u0438\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1814_%D0%B3%D0%BE%D0%B4\" title=\"1814 \u0433\u043e\u0434\">1814<\/a><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%BE%D1%80%D0%B2%D0%B5%D0%B3%D0%B8%D1%8F_(1814)\" title=\"\u041d\u043e\u0440\u0432\u0435\u0433\u0438\u044f (1814)\">\u0432 \u043d\u0435\u043d\u0430\u0434\u043e\u043b\u0433\u043e \u0441\u0442\u0430\u0432\u0448\u0435\u0439 \u043d\u0435\u0437\u0430\u0432\u0438\u0441\u0438\u043c\u043e\u0439 \u041d\u043e\u0440\u0432\u0435\u0433\u0438\u0438<\/a> \u043f\u0440\u0438\u043d\u044f\u0442\u0430 \u043f\u0435\u0440\u0432\u0430\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BD%D1%81%D1%82%D0%B8%D1%82%D1%83%D1%86%D0%B8%D1%8F_%D0%9D%D0%BE%D1%80%D0%B2%D0%B5%D0%B3%D0%B8%D0%B8\" title=\"\u041a\u043e\u043d\u0441\u0442\u0438\u0442\u0443\u0446\u0438\u044f \u041d\u043e\u0440\u0432\u0435\u0433\u0438\u0438\">\u043a\u043e\u043d\u0441\u0442\u0438\u0442\u0443\u0446\u0438\u044f<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%BE%D0%B9%D0%BD%D0%B0_%D0%B7%D0%B0_%D0%BD%D0%B5%D0%B7%D0%B0%D0%B2%D0%B8%D1%81%D0%B8%D0%BC%D0%BE%D1%81%D1%82%D1%8C_%D0%90%D1%80%D0%B3%D0%B5%D0%BD%D1%82%D0%B8%D0%BD%D1%8B\" title=\"\u0412\u043e\u0439\u043d\u0430 \u0437\u0430 \u043d\u0435\u0437\u0430\u0432\u0438\u0441\u0438\u043c\u043e\u0441\u0442\u044c \u0410\u0440\u0433\u0435\u043d\u0442\u0438\u043d\u044b\">\u0412\u043e\u0439\u043d\u0430 \u0437\u0430 \u043d\u0435\u0437\u0430\u0432\u0438\u0441\u0438\u043c\u043e\u0441\u0442\u044c \u0410\u0440\u0433\u0435\u043d\u0442\u0438\u043d\u044b<\/a>: \u0432 \u0445\u043e\u0434\u0435 <a href=\"https:\/\/es.wikipedia.org\/wiki\/Campa%C3%B1a_Naval_de_1814\" class=\"extiw\" title=\"es:Campa\u00f1a Naval de 1814\">\u041c\u043e\u0440\u0441\u043a\u043e\u0439 \u043a\u0430\u043c\u043f\u0430\u043d\u0438\u0438 1814 \u0433\u043e\u0434\u0430<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B0-%D0%9F%D0%BB%D0%B0%D1%82%D0%B0_(%D1%8D%D1%81%D1%82%D1%83%D0%B0%D1%80%D0%B8%D0%B9)\" title=\"\u041b\u0430-\u041f\u043b\u0430\u0442\u0430 (\u044d\u0441\u0442\u0443\u0430\u0440\u0438\u0439)\">\u041b\u0430-\u041f\u043b\u0430\u0442\u0435<\/a>, \u043d\u0430\u043f\u0440\u043e\u0442\u0438\u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D0%BD%D1%82%D0%B5%D0%B2%D0%B8%D0%B4%D0%B5%D0%BE\" title=\"\u041c\u043e\u043d\u0442\u0435\u0432\u0438\u0434\u0435\u043e\">\u041c\u043e\u043d\u0442\u0435\u0432\u0438\u0434\u0435\u043e<\/a> \u043f\u0440\u043e\u0438\u0437\u043e\u0448\u043b\u043e <a href=\"https:\/\/es.wikipedia.org\/wiki\/Combate_naval_del_Buceo\" class=\"extiw\" title=\"es:Combate naval del Buceo\">\u0441\u0440\u0430\u0436\u0435\u043d\u0438\u0435 \u043f\u0440\u0438 \u0411\u0443\u0441\u0435\u043e<\/a>, \u0432 \u043a\u043e\u0442\u043e\u0440\u043e\u043c \u0430\u0440\u0433\u0435\u043d\u0442\u0438\u043d\u0441\u043a\u0430\u044f \u044d\u0441\u043a\u0430\u0434\u0440\u0430 \u043f\u043e\u0434 \u043a\u043e\u043c\u0430\u043d\u0434\u043e\u0432\u0430\u043d\u0438\u0435\u043c \u0430\u0434\u043c\u0438\u0440\u0430\u043b\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%80%D0%B0%D1%83%D0%BD,_%D0%A3%D0%B8%D0%BB%D1%8C%D1%8F%D0%BC_(%D0%B0%D0%B4%D0%BC%D0%B8%D1%80%D0%B0%D0%BB)\" title=\"\u0411\u0440\u0430\u0443\u043d, \u0423\u0438\u043b\u044c\u044f\u043c (\u0430\u0434\u043c\u0438\u0440\u0430\u043b)\">\u0413\u0438\u043b\u044c\u0435\u0440\u043c\u043e \u0411\u0440\u0430\u0443\u043d\u0430<\/a> \u043d\u0430\u043d\u0435\u0441\u043b\u0430 \u043f\u043e\u0440\u0430\u0436\u0435\u043d\u0438\u0435 \u0438\u0441\u043f\u0430\u043d\u0441\u043a\u043e\u0439 \u044d\u0441\u043a\u0430\u0434\u0440\u0435, \u043f\u0440\u0435\u0434\u043e\u043f\u0440\u0435\u0434\u0435\u043b\u0438\u0432 \u043f\u0430\u0434\u0435\u043d\u0438\u0435 \u041c\u043e\u043d\u0442\u0435\u0432\u0438\u0434\u0435\u043e.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1837_%D0%B3%D0%BE%D0%B4\" title=\"1837 \u0433\u043e\u0434\">1837<\/a>&#160;\u2014 \u043d\u0430\u0447\u0430\u043b\u0441\u044f \u0432\u044b\u0445\u043e\u0434 \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u043e\u0439 \u0433\u0430\u0437\u0435\u0442\u044b \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B0%D0%BB%D1%82%D0%B8%D0%BC%D0%BE%D1%80_%D0%A1%D0%B0%D0%BD\" class=\"mw-redirect\" title=\"\u0411\u0430\u043b\u0442\u0438\u043c\u043e\u0440 \u0421\u0430\u043d\">\u0411\u0430\u043b\u0442\u0438\u043c\u043e\u0440 \u0421\u0430\u043d<\/a>\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1848_%D0%B3%D0%BE%D0%B4\" title=\"1848 \u0433\u043e\u0434\">1848<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/