3e\u043b\u0443\u043e\u0441\u0442\u0440\u043e\u0432\">\u0411\u0430\u043b\u043a\u0430\u043d\u0430\u0445<\/a>.<\/li><\/ul><h3>XX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1900_%D0%B3%D0%BE%D0%B4\" title=\"1900 \u0433\u043e\u0434\">1900<\/a>&#160;\u2014 \u0441\u043e\u0431\u044b\u0442\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D0%B3%D0%BB%D0%BE-%D0%B1%D1%83%D1%80%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0_(1899%E2%80%941902)\" title=\"\u0410\u043d\u0433\u043b\u043e-\u0431\u0443\u0440\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430 (1899\u20141902)\">\u0432\u0442\u043e\u0440\u043e\u0439 \u0430\u043d\u0433\u043b\u043e-\u0431\u0443\u0440\u0441\u043a\u043e\u0439 \u0432\u043e\u0439\u043d\u044b<\/a>&#160;\u2014 \u0441\u043d\u044f\u0442\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D1%81%D0%B0%D0%B4%D0%B0_%D0%9C%D0%B0%D1%84%D0%B5%D0%BA%D0%B8%D0%BD%D0%B3%D0%B0\" title=\"\u041e\u0441\u0430\u0434\u0430 \u041c\u0430\u0444\u0435\u043a\u0438\u043d\u0433\u0430\">\u043e\u0441\u0430\u0434\u044b \u041c\u0430\u0444\u0435\u043a\u0438\u043d\u0433\u0430<\/a> \u0431\u0440\u0438\u0442\u0430\u043d\u0441\u043a\u0438\u043c\u0438 \u0432\u043e\u0439\u0441\u043a\u0430\u043c\u0438 \u043f\u0440\u043e\u0442\u0438\u0432 \u0411\u0443\u0440\u0441\u043a\u0438\u0445 \u0432\u043e\u0439\u0441\u043a.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1909_%D0%B3%D0%BE%D0%B4\" title=\"1909 \u0433\u043e\u0434\">1909<\/a><ul><li>\u0417\u043d\u0430\u043c\u0435\u043d\u0438\u0442\u044b\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D1%83%D1%81%D1%81%D0%BA%D0%B8%D0%B9_%D0%B1%D0%B0%D0%BB%D0%B5%D1%82_%D0%94%D1%8F%D0%B3%D0%B8%D0%BB%D0%B5%D0%B2%D0%B0\" title=\"\u0420\u0443\u0441\u0441\u043a\u0438\u0439 \u0431\u0430\u043b\u0435\u0442 \u0414\u044f\u0433\u0438\u043b\u0435\u0432\u0430\">\u0420\u0443\u0441\u0441\u043a\u0438\u0435 \u0441\u0435\u0437\u043e\u043d\u044b<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D1%80%D0%B8%D0%B6\" title=\"\u041f\u0430\u0440\u0438\u0436\">\u041f\u0430\u0440\u0438\u0436\u0435<\/a> \u043d\u0430\u0447\u0438\u043d\u0430\u044e\u0442\u0441\u044f \u0430\u043d\u0442\u0440\u0435\u043f\u0440\u0435\u043d\u0451\u0440\u043e\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D1%8F%D0%B3%D0%B8%D0%BB%D0%B5%D0%B2,_%D0%A1%D0%B5%D1%80%D0%B3%D0%B5%D0%B9_%D0%9F%D0%B0%D0%B2%D0%BB%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0414\u044f\u0433\u0438\u043b\u0435\u0432, \u0421\u0435\u0440\u0433\u0435\u0439 \u041f\u0430\u0432\u043b\u043e\u0432\u0438\u0447\">\u0421\u0435\u0440\u0433\u0435\u0435\u043c \u0414\u044f\u0433\u0438\u043b\u0435\u0432\u044b\u043c<\/a>.<\/li><li>\u041f\u0440\u0438\u043a\u0430\u0437\u043e\u043c \u2116&#160;187 \u043f\u043e \u0412\u043e\u0435\u043d\u043d\u043e\u043c\u0443 \u0432\u0435\u0434\u043e\u043c\u0441\u0442\u0432\u0443 \u043d\u0430 \u0432\u043e\u043e\u0440\u0443\u0436\u0435\u043d\u0438\u0435 \u043d\u0438\u0436\u043d\u0438\u0445 \u0447\u0438\u043d\u043e\u0432 \u0430\u0440\u0442\u0438\u043b\u043b\u0435\u0440\u0438\u0441\u0442\u043e\u0432 \u0432\u0437\u0430\u043c\u0435\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%B0%D1%88%D0%BA%D0%B0_(%D0%BE%D1%80%D1%83%D0%B6%D0%B8%D0%B5)\" title=\"\u0428\u0430\u0448\u043a\u0430 (\u043e\u0440\u0443\u0436\u0438\u0435)\">\u0448\u0430\u0448\u043a\u0438<\/a> \u0432\u0432\u043e\u0434\u0438\u0442\u0441\u044f \u043a\u0440\u0438\u0432\u043e\u0439 \u043a\u0438\u043d\u0436\u0430\u043b-<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B5%D0%B1%D1%83%D1%82\" title=\"\u0411\u0435\u0431\u0443\u0442\">\u0431\u0435\u0431\u0443\u0442<\/a>.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1911_%D0%B3%D0%BE%D0%B4\" title=\"1911 \u0433\u043e\u0434\">1911<\/a>&#160;\u2014 \u0432\u044b\u0445\u043e\u0434 \u0432 \u0441\u0432\u0435\u0442 \u0441\u0431\u043e\u0440\u043d\u0438\u043a\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D1%8F%D0%BA%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B9,_%D0%92%D0%BB%D0%B0%D0%B4%D0%B8%D0%BC%D0%B8%D1%80_%D0%92%D0%BB%D0%B0%D0%B4%D0%B8%D0%BC%D0%B8%D1%80%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u041c\u0430\u044f\u043a\u043e\u0432\u0441\u043a\u0438\u0439, \u0412\u043b\u0430\u0434\u0438\u043c\u0438\u0440 \u0412\u043b\u0430\u0434\u0438\u043c\u0438\u0440\u043e\u0432\u0438\u0447\">\u0412\u043b\u0430\u0434\u0438\u043c\u0438\u0440\u0430 \u041c\u0430\u044f\u043a\u043e\u0432\u0441\u043a\u043e\u0433\u043e<\/a> \u00ab\u042f!\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1916_%D0%B3%D0%BE%D0%B4\" title=\"1916 \u0433\u043e\u0434\">1916<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D0%B3%D0%BB%D0%B8%D1%8F\" title=\"\u0410\u043d\u0433\u043b\u0438\u044f\">\u0410\u043d\u0433\u043b\u0438\u0438<\/a> \u0432\u043f\u0435\u0440\u0432\u044b\u0435 \u0432 \u043c\u0438\u0440\u0435 \u0441\u043e\u0432\u0435\u0440\u0448\u0451\u043d \u043f\u0435\u0440\u0435\u0445\u043e\u0434 \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B5%D1%82%D0%BD%D0%B5%D0%B5_%D0%B2%D1%80%D0%B5%D0%BC%D1%8F\" title=\"\u041b\u0435\u0442\u043d\u0435\u0435 \u0432\u0440\u0435\u043c\u044f\">\u043b\u0435\u0442\u043d\u0435\u0435 \u0432\u0440\u0435\u043c\u044f<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1917_%D0%B3%D0%BE%D0%B4\" title=\"1917 \u0433\u043e\u0434\">1917<\/a><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%80%D0%BE%D1%86%D0%BA%D0%B8%D0%B9,_%D0%9B%D0%B5%D0%B2_%D0%94%D0%B0%D0%B2%D0%B8%D0%B4%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0422\u0440\u043e\u0446\u043a\u0438\u0439, \u041b\u0435\u0432 \u0414\u0430\u0432\u0438\u0434\u043e\u0432\u0438\u0447\">\u0422\u0440\u043e\u0446\u043a\u0438\u0439<\/a> \u0432\u043e\u0437\u0432\u0440\u0430\u0449\u0430\u0435\u0442\u0441\u044f \u0438\u0437 \u0438\u0437\u0433\u043d\u0430\u043d\u0438\u044f \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D1%8F\" title=\"\u0420\u043e\u0441\u0441\u0438\u044f\">\u0420\u043e\u0441\u0441\u0438\u044e<\/a>. \u041e\u043d \u0438 \u0435\u0433\u043e \u0433\u0440\u0443\u043f\u043f\u0430 (\u043c\u0435\u0436\u0440\u0430\u0439\u043e\u043d\u0446\u0435\u0432) \u0441\u0431\u043b\u0438\u0436\u0430\u044e\u0442\u0441\u044f \u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BE%D0%BB%D1%8C%D1%88%D0%B5%D0%B2%D0%B8%D0%BA\" class=\"mw-redirect\" title=\"\u0411\u043e\u043b\u044c\u0448\u0435\u0432\u0438\u043a\">\u0431\u043e\u043b\u044c\u0448\u0435\u0432\u0438\u043a\u0430\u043c\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D1%82%D0%B5%D0%BD,_%D0%90%D0%BD%D1%80%D0%B8_%D0%A4%D0%B8%D0%BB%D0%B8%D0%BF%D0%BF\" title=\"\u041f\u0435\u0442\u0435\u043d, \u0410\u043d\u0440\u0438 \u0424\u0438\u043b\u0438\u043f\u043f\">\u0410\u043d\u0440\u0438 \u041f\u0435\u0442\u0435\u043d<\/a> (\u0431\u0443\u0434\u0443\u0449\u0438\u0439 \u0433\u043b\u0430\u0432\u0430 \u043f\u0440\u043e\u0444\u0430\u0448\u0438\u0441\u0442\u0441\u043a\u043e\u0433\u043e \u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D1%8F\" title=\"\u0424\u0440\u0430\u043d\u0446\u0438\u044f\">\u0424\u0440\u0430\u043d\u0446\u0438\u0438<\/a>) \u043d\u0430\u0437\u043d\u0430\u0447\u0435\u043d \u0433\u043b\u0430\u0432\u043d\u043e\u043a\u043e\u043c\u0430\u043d\u0434\u0443\u044e\u0449\u0438\u043c \u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u043e\u0439 \u0430\u0440\u043c\u0438\u0438.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1918_%D0%B3%D0%BE%D0%B4\" title=\"1918 \u0433\u043e\u0434\">1918<\/a>&#160;\u2014 \u043d\u0430\u0447\u0438\u043d\u0430\u0435\u0442\u0441\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%BE%D1%81%D1%81%D1%82%D0%B0%D0%BD%D0%B8%D0%B5_%D0%A7%D0%B5%D1%85%D0%BE%D1%81%D0%BB%D0%BE%D0%B2%D0%B0%D1%86%D0%BA%D0%BE%D0%B3%D0%BE_%D0%BA%D0%BE%D1%80%D0%BF%D1%83%D1%81%D0%B0\" title=\"\u0412\u043e\u0441\u0441\u0442\u0430\u043d\u0438\u0435 \u0427\u0435\u0445\u043e\u0441\u043b\u043e\u0432\u0430\u0446\u043a\u043e\u0433\u043e \u043a\u043e\u0440\u043f\u0443\u0441\u0430\">\u0432\u043e\u0441\u0441\u0442\u0430\u043d\u0438\u0435 \u0427\u0435\u0445\u043e\u0441\u043b\u043e\u0432\u0430\u0446\u043a\u043e\u0433\u043e \u043a\u043e\u0440\u043f\u0443\u0441\u0430<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B8%D0%B1%D0%B8%D1%80%D1%8C\" title=\"\u0421\u0438\u0431\u0438\u0440\u044c\">\u0421\u0438\u0431\u0438\u0440\u0438<\/a>. \u041d\u0430\u0447\u0430\u043b\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D1%80%D0%B0%D0%B6%D0%B4%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0_%D0%B2_%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B8\" title=\"\u0413\u0440\u0430\u0436\u0434\u0430\u043d\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430 \u0432 \u0420\u043e\u0441\u0441\u0438\u0438\">\u0433\u0440\u0430\u0436\u0434\u0430\u043d\u0441\u043a\u043e\u0439 \u0432\u043e\u0439\u043d\u044b \u0432 \u0420\u043e\u0441\u0441\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1919_%D0%B3%D0%BE%D0%B4\" title=\"1919 \u0433\u043e\u0434\">1919<\/a>&#160;\u2014 \u043e\u0431\u044a\u044f\u0432\u043b\u044f\u0435\u0442\u0441\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B0%D1%86%D0%B8%D0%BE%D0%BD%D0%B0%D0%BB%D0%B8%D0%B7%D0%B0%D1%86%D0%B8%D1%8F\" title=\"\u041d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u0438\u0437\u0430\u0446\u0438\u044f\">\u043d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u0438\u0437\u0430\u0446\u0438\u044f<\/a> \u0446\u0435\u0440\u043a\u043e\u0432\u043d\u043e\u0433\u043e \u0438 \u043c\u043e\u043d\u0430\u0441\u0442\u044b\u0440\u0441\u043a\u043e\u0433\u043e \u0438\u043c\u0443\u0449\u0435\u0441\u0442\u0432\u0430 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D1%8F\" title=\"\u0420\u043e\u0441\u0441\u0438\u044f\">\u0420\u043e\u0441\u0441\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1921_%D0%B3%D0%BE%D0%B4\" title=\"1921 \u0433\u043e\u0434\">1921<\/a>&#160;\u2014 \u043e\u0442\u043c\u0435\u043d\u044f\u0435\u0442\u0441\u044f \u0434\u0435\u043a\u0440\u0435\u0442 \u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B0%D1%86%D0%B8%D0%BE%D0%BD%D0%B0%D0%BB%D0%B8%D0%B7%D0%B0%D1%86%D0%B8%D1%8F\" title=\"\u041d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u0438\u0437\u0430\u0446\u0438\u044f\">\u043d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u0438\u0437\u0430\u0446\u0438\u0438<\/a> \u043c\u0435\u043b\u043a\u0438\u0445 \u043f\u0440\u0435\u0434\u043f\u0440\u0438\u044f\u0442\u0438\u0439, \u043d\u0430\u0447\u0430\u043b\u043e \u0434\u0435\u043d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u0438\u0437\u0430\u0446\u0438\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1924_%D0%B3%D0%BE%D0%B4\" title=\"1924 \u0433\u043e\u0434\">1924<\/a>&#160;\u2014 \u0441\u0432\u0430\u0434\u044c\u0431\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B8%D1%82%D1%80%D0%B8%D1%85,_%D0%9C%D0%B0%D1%80%D0%BB%D0%B5%D0%BD\" title=\"\u0414\u0438\u0442\u0440\u0438\u0445, \u041c\u0430\u0440\u043b\u0435\u043d\">\u041c\u0430\u0440\u043b\u0435\u043d \u0414\u0438\u0442\u0440\u0438\u0445<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%97%D0%B8%D0%B1%D0%B5%D1%80,_%D0%A0%D1%83%D0%B4%D0%BE%D0%BB%D1%8C%D1%84\" title=\"\u0417\u0438\u0431\u0435\u0440, \u0420\u0443\u0434\u043e\u043b\u044c\u0444\">\u0420\u0443\u0434\u043e\u043b\u044c\u0444\u0430 \u0417\u0438\u0431\u0435\u0440\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1928_%D0%B3%D0%BE%D0%B4\" title=\"1928 \u0433\u043e\u0434\">1928<\/a><ul><li>\u041d\u0430\u0447\u0430\u043b\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B5%D1%82%D0%BD%D0%B8%D0%B5_%D0%9E%D0%BB%D0%B8%D0%BC%D0%BF%D0%B8%D0%B9%D1%81%D0%BA%D0%B8%D0%B5_%D0%B8%D0%B3%D1%80%D1%8B_1928\" title=\"\u041b\u0435\u0442\u043d\u0438\u0435 \u041e\u043b\u0438\u043c\u043f\u0438\u0439\u0441\u043a\u0438\u0435 \u0438\u0433\u0440\u044b 1928\">IX \u041e\u043b\u0438\u043c\u043f\u0438\u0439\u0441\u043a\u0438\u0445 \u0438\u0433\u0440<\/a>, \u043f\u0440\u043e\u0432\u043e\u0434\u0438\u043c\u044b\u0445 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BC%D1%81%D1%82%D0%B5%D1%80%D0%B4%D0%B0%D0%BC\" title=\"\u0410\u043c\u0441\u0442\u0435\u0440\u0434\u0430\u043c\">\u0410\u043c\u0441\u0442\u0435\u0440\u0434\u0430\u043c\u0435<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B8%D0%B4%D0%B5%D1%80%D0%BB%D0%B0%D0%BD%D0%B4%D1%8B\" title=\"\u041d\u0438\u0434\u0435\u0440\u043b\u0430\u043d\u0434\u044b\">\u041d\u0438\u0434\u0435\u0440\u043b\u0430\u043d\u0434\u044b<\/a>).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D1%83%D1%81%D1%81%D0%BE%D0%BB%D0%B8%D0%BD%D0%B8,_%D0%91%D0%B5%D0%BD%D0%B8%D1%82%D0%BE\" title=\"\u041c\u0443\u0441\u0441\u043e\u043b\u0438\u043d\u0438, \u0411\u0435\u043d\u0438\u0442\u043e\">\u041c\u0443\u0441\u0441\u043e\u043b\u0438\u043d\u0438<\/a> \u0441\u043e\u0437\u0434\u0430\u043b \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%82%D0%B0%D0%BB%D0%B8%D1%8F\" title=\"\u0418\u0442\u0430\u043b\u0438\u044f\">\u0418\u0442\u0430\u043b\u0438\u0438<\/a> \u0421\u043b\u0443\u0436\u0431\u0443 \u0434\u043e\u0440\u043e\u0433 \u0434\u043b\u044f \u0441\u0442\u0440\u043e\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u0430 \u043f\u0435\u0440\u0432\u044b\u0445 \u0432 \u043c\u0438\u0440\u0435 \u0441\u043a\u043e\u0440\u043e\u0441\u0442\u043d\u044b\u0445 \u0430\u0432\u0442\u043e\u0441\u0442\u0440\u0430\u0434.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1929_%D0%B3%D0%BE%D0%B4\" title=\"1929 \u0433\u043e\u0434\">1929<\/a><ul><li>\u041f\u043e\u0441\u043b\u0435 \u0434\u043e\u043b\u0433\u0438\u0445 \u0440\u043e\u0437\u044b\u0441\u043a\u043e\u0432 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D0%B8%D0%BB%D0%B0%D0%B4%D0%B5%D0%BB%D1%8C%D1%84%D0%B8%D1%8F\" title=\"\u0424\u0438\u043b\u0430\u0434\u0435\u043b\u044c\u0444\u0438\u044f\">\u0424\u0438\u043b\u0430\u0434\u0435\u043b\u044c\u0444\u0438\u0438<\/a> \u0441\u0445\u0432\u0430\u0447\u0435\u043d \u0433\u043b\u0430\u0432\u0430 \u0442\u043e\u0440\u0433\u043e\u0432\u0446\u0435\u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BD%D1%82%D1%80%D0%B0%D0%B1%D0%B0%D0%BD%D0%B4%D0%B0\" title=\"\u041a\u043e\u043d\u0442\u0440\u0430\u0431\u0430\u043d\u0434\u0430\">\u043a\u043e\u043d\u0442\u0440\u0430\u0431\u0430\u043d\u0434\u043d\u044b\u043c\u0438<\/a> \u0441\u043f\u0438\u0440\u0442\u043d\u044b\u043c\u0438 \u043d\u0430\u043f\u0438\u0442\u043a\u0430\u043c\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BB%D1%8C_%D0%9A%D0%B0%D0%BF%D0%BE%D0%BD%D0%B5\" title=\"\u0410\u043b\u044c \u041a\u0430\u043f\u043e\u043d\u0435\">\u0410\u043b\u044c \u041a\u0430\u043f\u043e\u043d\u0435<\/a>, \u043a\u043e\u0442\u043e\u0440\u043e\u043c\u0443 \u0431\u044b\u043b\u043e \u043f\u0440\u0435\u0434\u044a\u044f\u0432\u043b\u0435\u043d\u043e \u043e\u0431\u0432\u0438\u043d\u0435\u043d\u0438\u0435 \u0432 \u043d\u0435\u0437\u0430\u043a\u043e\u043d\u043d\u043e\u043c \u0445\u0440\u0430\u043d\u0435\u043d\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B8%D1%81%D1%82%D0%BE%D0%BB%D0%B5%D1%82\" title=\"\u041f\u0438\u0441\u0442\u043e\u043b\u0435\u0442\">\u043f\u0438\u0441\u0442\u043e\u043b\u0435\u0442\u0430<\/a>.<\/li><li>\u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D0%BD%D1%80%D0%B5%D0%B0%D0%BB%D1%8C\" title=\"\u041c\u043e\u043d\u0440\u0435\u0430\u043b\u044c\">\u041c\u043e\u043d\u0440\u0435\u0430\u043b\u0435<\/a> \u043a\u0430\u043d\u0430\u0434\u0441\u043a\u0438\u0439 \u043f\u0438\u043b\u043e\u0442 \u041a\u043e\u043b\u0434\u0432\u0435\u043b \u0432\u043f\u0435\u0440\u0432\u044b\u0435 \u0432 \u041a\u0430\u043d\u0430\u0434\u0435 \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D1%80%D0%B0%D1%88%D1%8E%D1%82\" title=\"\u041f\u0430\u0440\u0430\u0448\u044e\u0442\">\u043f\u0430\u0440\u0430\u0448\u044e\u0442<\/a> \u0434\u04