f=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B5%D0%B4%D0%B8%D1%86%D0%B8%D0%BD%D1%81%D0%BA%D0%BE%D0%B5_%D1%81%D1%82%D1%80%D0%B0%D1%85%D0%BE%D0%B2%D0%B0%D0%BD%D0%B8%D0%B5\" title=\"\u041c\u0435\u0434\u0438\u0446\u0438\u043d\u0441\u043a\u043e\u0435 \u0441\u0442\u0440\u0430\u0445\u043e\u0432\u0430\u043d\u0438\u0435\">\u043c\u0435\u0434\u0438\u0446\u0438\u043d\u0441\u043a\u043e\u0435 \u0441\u0442\u0440\u0430\u0445\u043e\u0432\u0430\u043d\u0438\u0435<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1937_%D0%B3%D0%BE%D0%B4\" title=\"1937 \u0433\u043e\u0434\">1937<\/a>&#160;\u2014 \u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u043d\u0438\u0435 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%81%D0%BF%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0418\u0441\u043f\u0430\u043d\u0438\u044f\">\u0418\u0441\u043f\u0430\u043d\u0438\u0438<\/a> \u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u0430 \u0432\u043e \u0433\u043b\u0430\u0432\u0435 \u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B5%D0%B3%D1%80%D0%B8%D0%BD,_%D0%A5%D1%83%D0%B0%D0%BD\" title=\"\u041d\u0435\u0433\u0440\u0438\u043d, \u0425\u0443\u0430\u043d\">\u0425\u0443\u0430\u043d\u043e\u043c \u041d\u0435\u0433\u0440\u0438\u043d\u043e\u043c<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1938_%D0%B3%D0%BE%D0%B4\" title=\"1938 \u0433\u043e\u0434\">1938<\/a>&#160;\u2014 \u0412\u0430\u043b\u043b\u0438\u0439\u0441\u043a\u0438\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D1%80%D0%BA%D0%B8%D0%B7_%D0%91%D1%8C%D1%8E%D1%82\" title=\"\u041c\u0430\u0440\u043a\u0438\u0437 \u0411\u044c\u044e\u0442\">\u043c\u0430\u0440\u043a\u0438\u0437 \u0411\u044c\u044e\u0442<\/a> \u043f\u0440\u043e\u0434\u0430\u043b \u043f\u043e\u043b\u043e\u0432\u0438\u043d\u0443 \u0433\u043e\u0440\u043e\u0434\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%80%D0%B4%D0%B8%D1%84%D1%84\" title=\"\u041a\u0430\u0440\u0434\u0438\u0444\u0444\">\u041a\u0430\u0440\u0434\u0438\