0433\u043e\u0434\">1963<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D0%BD%D1%82%D0%B5%D1%80%D0%B5%D0%B9_(%D0%9A%D0%B0%D0%BB%D0%B8%D1%84%D0%BE%D1%80%D0%BD%D0%B8%D1%8F)\" title=\"\u041c\u043e\u043d\u0442\u0435\u0440\u0435\u0439 (\u041a\u0430\u043b\u0438\u0444\u043e\u0440\u043d\u0438\u044f)\">\u041c\u043e\u043d\u0442\u0435\u0440\u0435\u0435<\/a> (\u0448\u0442\u0430\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%BB%D0%B8%D1%84%D0%BE%D1%80%D0%BD%D0%B8%D1%8F\" title=\"\u041a\u0430\u043b\u0438\u0444\u043e\u0440\u043d\u0438\u044f\">\u041a\u0430\u043b\u0438\u0444\u043e\u0440\u043d\u0438\u044f<\/a>) \u043f\u0440\u043e\u0445\u043e\u0434\u0438\u0442 \u043f\u0435\u0440\u0432\u044b\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B0%D1%80%D0%BE%D0%B4%D0%BD%D0%B0%D1%8F_%D0%BC%D1%83%D0%B7%D1%8B%D0%BA%D0%B0\" title=\"\u041d\u0430\u0440\u043e\u0434\u043d\u0430\u044f \u043c\u0443\u0437\u044b\u043a\u0430\">\u0444\u043e\u043b\u043a<\/a>-\u0444\u0435\u0441\u0442\u0438\u0432\u0430\u043b\u044c, \u043d\u0430 \u043a\u043e\u0442\u043e\u0440\u043e\u043c \u0432\u044b\u0441\u0442\u0443\u043f\u0430\u044e\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B0%D0%B5%D0%B7,_%D0%94%D0%B6%D0%BE%D0%B0%D0%BD\" class=\"mw-redirect\" title=\"\u0411\u0430\u0435\u0437, \u0414\u0436\u043e\u0430\u043d\">\u0414\u0436\u043e\u0430\u043d \u0411\u0430\u044d\u0437<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BE%D0%B1_%D0%94%D0%B8%D0%BB%D0%B0%D0%BD\" title=\"\u0411\u043e\u0431 \u0414\u0438\u043b\u0430\u043d\">\u0411\u043e\u0431 \u0414\u0438\u043b\u0430\u043d<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B8%D0%B3%D0%B5%D1%80,_%D0%9F%D0%B8%D1%82\" title=\"\u0421\u0438\u0433\u0435\u0440, \u041f\u0438\u0442\">\u041f\u0438\u0442 \u0421\u0438\u0433\u0435\u0440<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1968_%D0%B3%D0%BE%D0%B4\" title=\"1968 \u0433\u043e\u0434\">1968<\/a>&#160;\u2014 \u0437\u0430\u043f\u0443\u0441\u043a \u043a\u043e\u0441\u043c\u0438\u0447\u0435\u0441\u043a\u043e\u0433\u043e \u0441\u043f\u0443\u0442\u043d\u0438\u043a\u0430 (<a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%95%D0%A1%D0%A0%D0%9E-2%D0%92&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u0415\u0421\u0420\u041e-2\u0412 (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u0415\u0421\u0420\u041e-2\u0412<\/a>), \u0440\u0430\u0437\u0440\u0430\u0431\u043e\u0442\u0430\u043d\u043d\u043e\u0433\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%95%D0%B2%D1%80%D0%BE%D0%BF%D0%B5%D0%B9%D1%81%D0%BA%D0%BE%D0%B5_%D0%BA%D0%BE%D1%81%D0%BC%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%BE%D0%B5_%D0%B0%D0%B3%D0%B5%D0%BD%D1%82%D1%81%D1%82%D0%B2%D0%BE\" title=\"\u0415\u0432\u0440\u043e\u043f\u0435\u0439\u0441\u043a\u043e\u0435 \u043a\u043e\u0441\u043c\u0438\u0447\u0435\u0441\u043a\u043e\u0435 \u0430\u0433\u0435\u043d\u0442\u0441\u0442\u0432\u043e\">\u0435\u0432\u0440\u043e\u043f\u0435\u0439\u0441\u043a\u0438\u043c \u043a\u043e\u0441\u043c\u0438\u0447\u0435\u0441\u043a\u0438\u043c \u0430\u0433\u0435\u043d\u0442\u0441\u0442\u0432\u043e\u043c<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1969_%D0%B3%D0%BE%D0%B4\" title=\"1969 \u0433\u043e\u0434\">1969<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B2%D1%82%D0%BE%D0%BC%D0%B0%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B0%D1%8F_%D0%BC%D0%B5%D0%B6%D0%BF%D0%BB%D0%B0%D0%BD%D0%B5%D1%82%D0%BD%D0%B0%D1%8F_%D1%81%D1%82%D0%B0%D0%BD%D1%86%D0%B8%D1%8F\" title=\"\u0410\u0432\u0442\u043e\u043c\u0430\u0442\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u043c\u0435\u0436\u043f\u043b\u0430\u043d\u0435\u0442\u043d\u0430\u044f \u0441\u0442\u0430\u043d\u0446\u0438\u044f\">\u0410\u0432\u0442\u043e\u043c\u0430\u0442\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u043c\u0435\u0436\u043f\u043b\u0430\u043d\u0435\u0442\u043d\u0430\u044f \u0441\u0442\u0430\u043d\u0446\u0438\u044f<\/a> \u00a