ipedia.org\/wiki\/%D0%98%D0%B7%D1%80%D0%B0%D0%B8%D0%BB%D1%8C\" title=\"\u0418\u0437\u0440\u0430\u0438\u043b\u044c\">\u0418\u0437\u0440\u0430\u0438\u043b\u0435\u043c<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B8%D0%B2%D0%B0%D0%BD\" title=\"\u041b\u0438\u0432\u0430\u043d\">\u041b\u0438\u0432\u0430\u043d\u043e\u043c<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1985_%D0%B3%D0%BE%D0%B4\" title=\"1985 \u0433\u043e\u0434\">1985<\/a>&#160;\u2014 \u0432\u044b\u0441\u0442\u0443\u043f\u0430\u044f \u043d\u0430 \u0441\u043e\u0431\u0440\u0430\u043d\u0438\u0438 \u0430\u043a\u0442\u0438\u0432\u0430 \u041b\u0435\u043d\u0438\u043d\u0433\u0440\u0430\u0434\u0441\u043a\u043e\u0439 \u043f\u0430\u0440\u0442\u0438\u0439\u043d\u043e\u0439 \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u0438, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D0%BD%D0%B5%D1%80%D0%B0%D0%BB%D1%8C%D0%BD%D1%8B%D0%B9_%D1%81%D0%B5%D0%BA%D1%80%D0%B5%D1%82%D0%B0%D1%80%D1%8C_%D0%A6%D0%9A_%D0%9A%D0%9F%D0%A1%D0%A1\" title=\"\u0413\u0435\u043d\u0435\u0440\u0430\u043b\u044c\u043d\u044b\u0439 \u0441\u0435\u043a\u0440\u0435\u0442\u0430\u0440\u044c \u0426\u041a \u041a\u041f\u0421\u0421\">\u0413\u0435\u043d\u0435\u0440\u0430\u043b\u044c\u043d\u044b\u0439 \u0441\u0435\u043a\u0440\u0435\u0442\u0430\u0440\u044c \u0426\u041a \u041a\u041f\u0421\u0421<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BE%D1%80%D0%B1%D0%B0%D1%87%D1%91%D0%B2,_%D0%9C%D0%B8%D1%85%D0%B0%D0%B8%D0%BB_%D0%A1%D0%B5%D1%80%D0%B3%D0%B5%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u0413\u043e\u0440\u0431\u0430\u0447\u0451\u0432, \u041c\u0438\u0445\u0430\u0438\u043b \u0421\u0435\u0440\u0433\u0435\u0435\u0432\u0438\u0447\">\u041c.&#160;\u0421.&#160;\u0413\u043e\u0440\u0431\u0430\u0447\u0451\u0432<\/a> \u0432\u043f\u0435\u0440\u0432\u044b\u0435 \u043f\u0440\u043e\u0432\u043e\u0437\u0433\u043b\u0430\u0448\u0430\u0435\u0442 \u043b\u043e\u0437\u0443\u043d\u0433 \u00ab\u0443\u0441\u043a\u043e\u0440\u0435\u043d\u0438\u044f\u00bb, \u0437\u0430\u044f\u0432\u0438\u0432, \u0447\u0442\u043e \u0441\u043e\u0432\u0435\u0442\u0441\u043a\u0438\u0435 \u043b\u044e\u0434\u0438 \u0433\u043e\u0442\u043e\u0432\u044b \u0438 \u0432\u043f\u0440\u0435\u0434\u044c \u0430\u043a\u0442\u0438\u0432\u043d\u043e \u0443\u0447\u0430\u0441\u0442\u0432\u043e\u0432\u0430\u0442\u044c \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BC%D0%BC%D1%83%D0%BD%D0%B8%D0%B7%D0%BC\" title=\"\u041a\u043e\u043c\u043c\u0443\u043d\u0438\u0437\u043c\">\u043a\u043e\u043c\u043c\u0443\u043d\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u043c<\/a> \u0441\u0442\u0440\u043e\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u0435.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1987_%D0%B3%D0%BE%D0%B4\" title=\"1987 \u0433\u043e\u0434\">1987<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%80%D0%B0%D0%BD%D0%BE-%D0%B8%D1%80%D0%B0%D0%BA%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\" title=\"\u0418\u0440\u0430\u043d\u043e-\u0438\u0440\u0430\u043a\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430\">\u0438\u0440\u0430\u043d\u043e-\u0438\u0440\u0430\u043a\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430<\/a>: <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%BD%D1%86%D0%B8%D0%B4%D0%B5%D0%BD%D1%82_%D1%81_%D1%84%D1%80%D0%B5%D0%B3%D0%B0%D1%82%D0%BE%D0%BC_%C2%AB%D0%A1%D1%82%D0%B0%D1%80%D0%BA%C2%BB\" title=\"\u0418\u043d\u0446\u0438\u0434\u0435\u043d\u0442 \u0441 \u0444\u0440\u0435\u0433\u0430\u0442\u043e\u043c \u00ab\u0421\u0442\u0430\u0440\u043a\u00bb\">\u0438\u043d\u0446\u0438\u0434\u0435\u043d\u0442 \u0441 \u0444\u0440\u0435\u0433\u0430\u0442\u043e\u043c \u00ab\u0421\u0442\u0430\u0440\u043a\u00bb<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D1%80%D1%81%D0%B8%D0%B4%D1%81%D0%BA%D0%B8%D0%B9_%D0%B7%D0%B0%D0%BB%D0%B8%D0%B2\" title=\"\u041f\u0435\u0440\u0441\u0438\u0434\u0441\u043a\u0438\u0439 \u0437\u0430\u043b\u0438\u0432\">\u041f\u0435\u0440\u0441\u0438\u0434\u0441\u043a\u043e\u043c \u0437\u0430\u043b\u0438\u0432\u0435<\/a>. \u041f\u043e\u0433\u0438\u0431\u043b\u043e 37 \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0446\u0435\u0432. \u0421\u0428\u0410 \u0438 \u0418\u0440\u0430\u043a \u043f\u0440\u0438\u0437\u043d\u0430\u043b\u0438 \u0438\u043d\u0446\u0438\u0434\u0435\u043d\u0442 \u043e\u0448\u0438\u0431\u043a\u043e\u0439.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1990_%D0%B3%D0%BE%D0%B4\" title=\"1990 \u0433\u043e\u0434\">1990<\/a><ul><li>\u0412 \u043d\u043e\u0447\u044c \u0441 17 \u043d\u0430 18 \u043c\u0430\u044f \u0432 20&#160;\u043a\u043c \u0437\u0430\u043f\u0430\u0434\u043d\u0435\u0435 \u0433\u043e\u0440\u043e\u0434\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%82%D0%B5%D1%80%D0%BB%D0%B8%D1%82%D0%B0%D0%BC%D0%B0%D0%BA\" title=\"\u0421\u0442\u0435\u0440\u043b\u0438\u0442\u0430\u043c\u0430\u043a\">\u0421\u0442\u0435\u0440\u043b\u0438\u0442\u0430\u043c\u0430\u043a<\/a> \u0443\u043f\u0430\u043b \u043c\u0435\u0442\u0435\u043e\u0440\u0438\u0442 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%82%D0%B5%D1%80%D0%BB%D0%B8%D1%82%D0%B0%D0%BC%D0%B0%D0%BA_(%D0%BC%D0%B5%D1%82%D0%B5%D0%BE%D1%80%D0%B8%D1%82)\" title=\"\u0421\u0442\u0435\u0440\u043b\u0438\u0442\u0430\u043c\u0430\u043a (\u043c\u0435\u0442\u0435\u043e\u0440\u0438\u0442)\">\u0421\u0442\u0435\u0440\u043b\u0438\u0442\u0430\u043c\u0430\u043a<\/a>\u00bb.<\/li><li>\u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%A1%D0%A4%D0%A1%D0%A0\" class=\"mw-redirect\" title=\"\u0420\u0421\u0424\u0421\u0420\">\u0420\u0421\u0424\u0421\u0420<\/a> \u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B0%D0%BB%D0%B4%D0%B0%D0%B9%D1%81%D0%BA%D0%B8%D0%B9_%D0%BD%D0%B0%D1%86%D0%B8%D0%BE%D0%BD%D0%B0%D0%BB%D1%8C%D0%BD%D1%8B%D0%B9_%D0%BF%D0%B0%D1%80%D0%BA\" title=\"\u0412\u0430\u043b\u0434\u0430\u0439\u0441\u043a\u0438\u0439 \u043d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u044b\u0439 \u043f\u0430\u0440\u043a\">\u0412\u0430\u043b\u0434\u0430\u0439\u0441\u043a\u0438\u0439 \u043d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u044b\u0439 \u043f\u0430\u0440\u043a<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D1%81%D0%B5%D0%BC%D0%B8%D1%80%D0%BD%D0%B0%D1%8F_%D0%BE%D1%80%D0%B3%D0%B0%D0%BD%D0%B8%D0%B7%D0%B0%D1%86%D0%B8%D1%8F_%D0%B7%D0%B4%D1%80%D0%B0%D0%B2%D0%BE%D0%BE%D1%85%D1%80%D0%B0%D0%BD%D0%B5%D0%BD%D0%B8%D1%8F\" title=\"\u0412\u0441\u0435\u043c\u0438\u0440\u043d\u0430\u044f \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u044f \u0437\u0434\u0440\u0430\u0432\u043e\u043e\u0445\u0440\u0430\u043d\u0435\u043d\u0438\u044f\">\u0412\u0441\u0435\u043c\u0438\u0440\u043d\u0430\u044f \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u044f \u0437\u0434\u0440\u0430\u0432\u043e\u043e\u0445\u0440\u0430\u043d\u0435\u043d\u0438\u044f<\/a> \u0438\u0441\u043a\u043b\u044e\u0447\u0438\u043b\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BE%D0%BC%D0%BE%D1%81%D0%B5%D0%BA%D1%81%D1%83%D0%B0%D0%BB%D1%8C%D0%BD%D0%BE%D1%81%D1%82%D1%8C\" title=\"\u0413\u043e\u043c\u043e\u0441\u0435\u043a\u0441\u0443\u0430\u043b\u044c\u043d\u043e\u0441\u0442\u044c\">\u0433\u043e\u043c\u043e\u0441\u0435\u043a\u0441\u0443\u0430\u043b\u044c\u043d\u043e\u0441\u0442\u044c<\/a> \u0438\u0437 \u0441\u043f\u0438\u0441\u043a\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%81%D0%B8%D1%85%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%BE%D0%B5_%D1%80%D0%B0%D1%81%D1%81%D1%82%D1%80%D0%BE%D0%B9%D1%81%D1%82%D0%B2%D0%BE\" title=\"\u041f\u0441\u0438\u0445\u0438\u0447\u0435\u0441\u043a\u043e\u0435 \u0440\u0430\u0441\u0441\u0442\u0440\u043e\u0439\u0441\u0442\u0432\u043e\">\u043f\u0441\u0438\u0445\u0438\u0447\u0435\u0441\u043a\u0438\u0445 \u0437\u0430\u0431\u043e\u043b\u0435\u0432\u0430\u043d\u0438\u0439<\/a>.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1992_%D0%B3%D0%BE%D0%B4\" title=\"1992 \u0433\u043e\u0434\">1992<\/a>&#160;\u2014 \u043a\u043e\u043c\u043f\u0430\u043d\u0438\u044f \u0438\u0437 7 \u043f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\u0441\u043a\u0438\u0445 \u0445\u0443\u0434\u043e\u0436\u043d\u0438\u043a\u043e\u0432-\u043a\u043e\u043d\u0446\u0435\u043f\u0442\u0443\u0430\u043b\u0438\u0441\u0442\u043e\u0432 \u00ab\u0422\u0443\u0442-\u0438-\u0442\u0430\u043c\u00bb \u0432\u0441\u043a\u0430\u043f\u044b\u0432\u0430\u0435\u0442 \u0432 \u043a\u0440\u0443\u0433\u043b\u043e\u043c \u0434\u0432\u043e\u0440\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BA%D0%B0%D0%B4%D0%B5%D0%BC%D0%B8%D1%8F_%D1%85%D1%83%D0%B4%D0%BE%D0%B6%D0%B5%D1%81%D1%82%D0%B2\" title=\"\u0410\u043a\u0430\u0434\u0435\u043c\u0438\u044f \u0445\u0443\u0434\u043e\u0436\u0435\u0441\u0442\u0432\">\u0410\u043a\u0430\u0434\u0435\u043c\u0438\u0438 \u0445\u0443\u0434\u043e\u0436\u0435\u0441\u0442\u0432<\/a> \u043a\u0432\u0430\u0434\u0440\u0430\u0442 (6&#160;\u00d7&#160;6 \u043c) \u0438 \u0437\u0430\u0441\u0435\u0438\u0432\u0430\u0435\u0442 \u043c\u043e\u0440\u043a\u043e\u0432\u044c\u044e \u00ab\u041e\u0433\u043e\u0440\u043e\u0434 \u041c\u0430\u043b\u0435\u0432\u0438\u0447\u0430\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1994_%D0%B3%D0%BE%D0%B4\" title=\"1994 \u0433\u043e\u0434\">1994<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B8%D1%81%D1%82%D1%8C%D0%B5%D0%B2,_%D0%92%D0%BB%D0%B0%D0%B4%D0%B8%D1%81%D0%BB%D0%B0%D0%B2_%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u041b\u0438\u0441\u0442\u044c\u0435\u0432, \u0412\u043b\u0430\u0434\u0438\u0441\u043b\u0430\u0432 \u041d\u0438\u043a\u043e\u043b\u0430\u0435\u0432\u0438\u0447\">\u0412\u043b\u0430\u0434\u0438\u0441\u043b\u0430\u0432 \u041b\u0438\u0441\u0442\u044c\u0435\u0432<\/a> \u043f\u043e\u043a\u0438\u043d\u0443\u043b \u043f\u0440\u043e\u0433\u0440\u0430\u043c\u043c\u0443 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B5%D0%BC%D0%B0_(%D1%82%D0%B5%D0%BB%D0%B5%D0%BF%D1%80%D0%BE